import React from 'react'
//@ts-ignore
import 'aframe';
import {Entity, Scene} from 'aframe-react';

export default class LocalScene {
    render() {
        return (                
        <Scene renderer="antialias: true"
        environment={{
            preset: 'starry',
            seed: 2,
            lightPosition: { x: 0.0, y: 0.03, z: -0.5 },
            fog: 0.8,
            ground: 'canyon',
            groundYScale: 6.31,
            groundTexture: 'walkernoise',
            groundColor: '#8a7f8a',
            grid: 'none'
          }}>


                </Scene>
        )
    }
}
